const columns = [  {    title: 'Padrao',    dataIndex: 'padrao',    key: 'padrao',    width: 100,    fixed: 'left',  },  {    title: 'F/mm',    dataIndex: 'f/mm',    key: 'f/mm',    width: 100,    fixed: 'left',  },  {    title: 'Unidades',    children: [      {        title: 'Fim da Protecao de Molde',        dataIndex: 'fim-da-protecao-de-molde',        key: 'fim-da-protecao-de-molde',        children: [          {            title: 'Forca',            dataIndex: 'fim-da-protecao-de-molde-forca',            key: 'fim-da-protecao-de-molde-forca',            width: 100,          },          {            title: 'Ponto',            dataIndex: 'fim-da-protecao-de-molde-ponto',            key: 'fim-da-protecao-de-molde-ponto',            width: 100,          },        ],
      },
      {
        title: 'Pressao de Protecao de Molde',
        dataIndex: 'pressao-de-protecao-de-molde',
        key: 'pressao-de-protecao-de-molde',
        children: [
          {
            title: 'Forca',
            dataIndex: 'pressao-de-protecao-de-molde-forca',
            key: 'pressao-de-protecao-de-molde-forca',
            width: 100,
          },
          {
            title: 'Ponto',
            dataIndex: 'pressao-de-protecao-de-molde-ponto',
            key: 'pressao-de-protecao-de-molde-ponto',
            width: 100,
          },
        ],
      },
    ],
  },
  {
    title: '900',
    dataIndex: '900',
    key: '900',
    width: 100,
  },
  {
    title: '0.5',
    dataIndex: '0.5',
    key: '0.5',
    width: 100,
  },
  {
    title: '14',
    dataIndex: '14',
    key: '14',
    width: 100,
  },
  {
    title: '55',
    dataIndex: '55',
    key: '55',
    width: 100,
  },
];

const data = [  {    key: '1',    padrao: 'Padrao',    'f/mm': 'F/mm',    'fim-da-protecao-de-molde-forca': '300N',    'fim-da-protecao-de-molde-ponto': '50mm',    'pressao-de-protecao-de-molde-forca': '100N',    'pressao-de-protecao-de-molde-ponto': '20mm',    '900': '900',    '0.5': '0.5',    '14': '14',    '55': '55',  },];

const App = () => (
  <Table columns={columns} dataSource={data} scroll={{ x: 1000 }} />
);

export default App;
